import "./LoginCard.css";


const LoginCard = () =>{
    return(
        <div className="box">
            <div className="box-input">
                <h3>Login </h3>
                <label>
                    <input type="email"  name="email" placeholder="Enter Email ID" size={60} height={40}/>
                </label>
            </div>
            <div className="box-input">
                <label>
                    
                    <input type="text" placeholder="Enter Password" size={60} />
                </label>
            </div>
        </div>
    )
}

export default LoginCard;
